Another nicer possibility is, to tell Iai-Callgrind to not capture output with the --nocapture (env: IAI_CALLGRIND_NOCAPTURE) option. This is currently restricted to the callgrind run to prevent showing the same output multiple times. So, any terminal output of other tool runs is still captured. The --nocapture flag takes the special values stdout and stderr in addition to true and false: --nocapture=true|false|stdout|stderr In the --nocapture=stdout case, terminal output to stdout is not captured and shown during the benchmark run but output to stderr is discarded. Likewise, --nocapture=stderr shows terminal output to stderr but discards output to stdout. Let's take as example a library benchmark benches/my_benchmark.rs # extern crate iai_callgrind;
use iai_callgrind::{library_benchmark, library_benchmark_group, main};
use std::hint::black_box; fn print_to_stderr(value: u64) { eprintln!("Error output during teardown: {value}");
} fn add_10_and_print(value: u64) -> u64 { let value = value + 10; println!("Output to stdout: {value}"); value
} #[library_benchmark]
#[bench::some_id(args = (10), teardown = print_to_stderr)]
fn bench_library(value: u64) -> u64 { black_box(add_10_and_print(value))
} library_benchmark_group!(name = my_group; benchmarks = bench_library);
# fn main() {
main!(library_benchmark_groups = my_group);
# } If the above benchmark is run with cargo bench --bench my_benchmark -- --nocapture, the output of Iai-Callgrind will look like this: my_benchmark::my_group::bench_library some_id:10
Output to stdout: 20
Error output during teardown: 20
- end of stdout/stderr Instructions: 851|N/A (*********) L1 Hits: 1193|N/A (*********) L2 Hits: 5|N/A (*********) RAM Hits: 66|N/A (*********) Total read+write: 1264|N/A (*********) Estimated Cycles: 3528|N/A (*********) Iai-Callgrind result: Ok. 1 without regressions; 0 regressed; 1 benchmarks finished in 0.49333s Everything between the headline and the - end of stdout/stderr line is output from your benchmark. The - end of stdout/stderr line changes depending on the options you have given. For example in the --nocapture=stdout case this line indicates your chosen option with - end of stdout. Note that independently of the value of the --nocapture option, all logging output of a valgrind tool itself is stored in files in the output directory of the benchmark. Since Iai-Callgrind needs the logging output of valgrind tools stored in files, there is no option to disable the creation of these log files. But, if anything goes sideways you might be glad to have the log files around.

18.body:
Almost all binary benchmarks can be written as library benchmarks. For example, if you have a main.rs file of your binary, which basically looks like this # mod my_lib { pub fn run() {} }
use my_lib::run; fn main() { run();
} you could also choose to benchmark the library function my_lib::run in a library benchmark instead of the binary in a binary benchmark. There's no real downside to either of the benchmark schemes and which scheme you want to use heavily depends on the structure of your binary. As a maybe obvious rule of thumb, micro-benchmarks of specific functions should go into library benchmarks and macro-benchmarks into binary benchmarks. Generally, choose the closest access point to the program point you actually want to benchmark. You should always choose binary benchmarks over library benchmarks if you want to benchmark the behaviour of the executable if the input comes from a pipe since this feature is exclusive to binary benchmarks. See The Command's stdin and simulating piped input for more.

