The environment variables are cleared before running a library benchmark. Have a look into the Configuration section if you need to change that behavior. Iai-Callgrind sometimes deviates from the valgrind defaults which are: Iai-Callgrind Valgrind (v3.23) --trace-children=yes --trace-children=no --fair-sched=try --fair-sched=no --separate-threads=yes --separate-threads=no --cache-sim=yes --cache-sim=no The thread and subprocess specific valgrind options enable tracing threads and subprocesses basically but there's usually some additional configuration necessary to trace the metrics of threads and subprocesses . As show in the table above, the benchmarks run with cache simulation switched on. This adds run time. If you don't need the cache metrics and estimation of cycles, you can easily switch cache simulation off for example with: # extern crate iai_callgrind;
