This attribute needs to be present on all benchmark functions specified in the library_benchmark_group . The benchmark function can then be further annotated with the inner #[bench] or #[benches] attributes. # extern crate iai_callgrind;
# mod my_lib { pub fn bubble_sort(value: Vec<i32>) -> Vec<i32> { value } }
use iai_callgrind::{library_benchmark, library_benchmark_group, main};
use std::hint::black_box; #[library_benchmark]
#[bench::one(vec![1])]
#[benches::multiple(vec![1, 2], vec![1, 2, 3], vec![1, 2, 3, 4])]
fn bench_bubble_sort(values: Vec<i32>) -> Vec<i32> { black_box(my_lib::bubble_sort(values))
} library_benchmark_group!(name = bubble_sort_group; benchmarks = bench_bubble_sort);
# fn main() {
main!(library_benchmark_groups = bubble_sort_group);
# } The following parameters are accepted: config: Takes a LibraryBenchmarkConfig setup: A global setup function which is applied to all following #[bench] and #[benches] attributes if not overwritten by a setup parameter of these attributes. teardown: Similar to setup but takes a global teardown function. # extern crate iai_callgrind;
