use iai_callgrind::{ library_benchmark, library_benchmark_group, main, LibraryBenchmarkConfig, OutputFormat
};
use std::hint::black_box; #[library_benchmark( config = LibraryBenchmarkConfig::default() .output_format(OutputFormat::default() .truncate_description(None) )
)]
#[bench::one(vec![1])]
fn bench_bubble_sort(values: Vec<i32>) -> Vec<i32> { black_box(my_lib::bubble_sort(values))
} library_benchmark_group!(name = bubble_sort_group; benchmarks = bench_bubble_sort);
# fn main() {
main!(library_benchmark_groups = bubble_sort_group);
# }

