33.body:
In an ideal world you don't need any setup code, and you can pass arguments to the function as they are. But, for example if a function expects a File and not a &str with the path to the file you need setup code. Iai-Callgrind has an easy-to-use system in place to allow you to run any setup code before the function is executed and this setup code is not attributed to the metrics of the benchmark. If the setup parameter is specified, the setup function takes the arguments from the #[bench] (or #[benches]) attributes and the benchmark function receives the return value of the setup function as parameter. This is a small indirection with great effect. The effect is best shown with an example: # extern crate iai_callgrind;
# mod my_lib { pub fn count_bytes_fast(_file: std::fs::File) -> u64 { 1 } }
use iai_callgrind::{library_benchmark, library_benchmark_group, main}; use std::hint::black_box;
use std::path::PathBuf;
use std::fs::File; fn open_file(path: &str) -> File { File::open(path).unwrap()
} #[library_benchmark]
#[bench::first(args = ("path/to/file"), setup = open_file)]
fn count_bytes_fast(file: File) -> u64 { black_box(my_lib::count_bytes_fast(file))
} library_benchmark_group!(name = my_group; benchmarks = count_bytes_fast);
# fn main() {
main!(library_benchmark_groups = my_group);
# } You can actually see the effect of using a setup function in the output of the benchmark. Let's assume the above benchmark is in a file benches/my_benchmark.rs, then running IAI_CALLGRIND_NOCAPTURE=true cargo bench result in the benchmark output like below. my_benchmark::my_group::count_bytes_fast first:open_file("path/to/file") Instructions: 1630162|N/A (*********) L1 Hits: 2507933|N/A (*********) L2 Hits: 2|N/A (*********) RAM Hits: 11|N/A (*********) Total read+write: 2507946|N/A (*********) Estimated Cycles: 2508328|N/A (*********) Iai-Callgrind result: Ok. 1 without regressions; 0 regressed; 1 benchmarks finished in 0.49333s The description in the headline contains open_file("path/to/file"), your setup function open_file with the value of the parameter it is called with. If you need to specify the same setup function for all (or almost all) #[bench] and #[benches] in a #[library_benchmark] you can use the setup parameter of the #[library_benchmark]: # extern crate iai_callgrind;
# mod my_lib { pub fn count_bytes_fast(_file: std::fs::File) -> u64 { 1 } }
use iai_callgrind::{library_benchmark, library_benchmark_group, main}; use std::hint::black_box;
use std::path::PathBuf;
use std::fs::File;
use std::io::{Seek, SeekFrom}; fn open_file(path: &str) -> File { File::open(path).unwrap()
} fn open_file_with_offset(path: &str, offset: u64) -> File { let mut file = File::open(path).unwrap(); file.seek(SeekFrom::Start(offset)).unwrap(); file
} #[library_benchmark(setup = open_file)]
#[bench::small("path/to/small")]
#[bench::big("path/to/big")]
#[bench::with_offset(args = ("path/to/big", 100), setup = open_file_with_offset)]
fn count_bytes_fast(file: File) -> u64 { black_box(my_lib::count_bytes_fast(file))
} library_benchmark_group!(name = my_group; benchmarks = count_bytes_fast);
# fn main() {
main!(library_benchmark_groups = my_group);
# } The above will use the open_file function in the small and big benchmarks and the open_file_with_offset function in the with_offset benchmark.

