Reading inputs from a file allows for example sharing the same inputs between different benchmarking frameworks like criterion or if you simply have a long list of inputs you might find it more convenient to read them from a file. The file parameter, exclusive to the #[benches] attribute, does exactly that and reads the specified file line by line creating a benchmark from each line. The line is passed to the benchmark function as String or if the setup parameter is also present to the setup function. A small example assuming you have a file benches/inputs (relative paths are interpreted to the workspace root) with the following content 1
11
111 then # extern crate iai_callgrind;
# mod my_lib { pub fn string_to_u64(value: String) -> Result<u64, String> { Ok(1) } }
use iai_callgrind::{library_benchmark, library_benchmark_group, main};
use std::hint::black_box; #[library_benchmark]
#[benches::from_file(file = "benches/inputs")]
fn some_bench(line: String) -> Result<u64, String> { black_box(my_lib::string_to_u64(line))
} library_benchmark_group!(name = my_group; benchmarks = some_bench);
# fn main() {
main!(library_benchmark_groups = my_group);
# } The above is roughly equivalent to the following but with the args parameter # extern crate iai_callgrind;
# mod my_lib { pub fn string_to_u64(value: String) -> Result<u64, String> { Ok(1) } }
use iai_callgrind::{library_benchmark, library_benchmark_group, main};
use std::hint::black_box; #[library_benchmark]
#[benches::from_args(args = [1.to_string(), 11.to_string(), 111.to_string()])]
fn some_bench(line: String) -> Result<u64, String> { black_box(my_lib::string_to_u64(line))
} library_benchmark_group!(name = my_group; benchmarks = some_bench);
# fn main() {
main!(library_benchmark_groups = my_group);
# } The true power of the file parameter comes with the setup function because you can format the lines in the file as you like and convert each line in the setup function to the format as you need it in the benchmark. For example if you decided to go with a csv like format in the file benches/inputs 255;255;255
0;0;0 and your library has a function which converts from RGB to HSV color space: # extern crate iai_callgrind;
