Callgrind collects metrics and associates them with a function. This happens based on the compiled code not the source code, so it is possible to hook into any function not only public functions. Callgrind can be configured to switch instrumentation on and off based on a function name with --toggle-collect . Per default, Iai-Callgrind sets this toggle (which we call EntryPoint ) to the benchmarking function. Setting the toggle implies --collect-atstart=no. So, all events before (in the setup) and after the benchmark function (in the teardown) are not collected. Somewhat simplified, but conveying the basic idea, here is a commented example: // <-- collect-at-start=no # extern crate iai_callgrind;
# mod my_lib { pub fn bubble_sort(_: Vec<i32>) -> Vec<i32> { vec![] } }
use iai_callgrind::{main,library_benchmark_group, library_benchmark};
use std::hint::black_box; #[library_benchmark]
fn bench() -> Vec<i32> { // <-- DEFAULT ENTRY POINT starts collecting events black_box(my_lib::bubble_sort(vec![3, 2, 1]))
} // <-- stop collecting events library_benchmark_group!( name = my_group; benchmarks = bench);
# fn main() {
main!(library_benchmark_groups = my_group);
# }

