The basic idea is to choose a public function in your library acting as access point to the actual function you want to benchmark. As outlined before, this works only reliably for functions which are not inlined by the compiler. # extern crate iai_callgrind;
use iai_callgrind::{ main, library_benchmark_group, library_benchmark, LibraryBenchmarkConfig, EntryPoint, Callgrind
};
use std::hint::black_box; mod my_lib { #[inline(never)] fn bubble_sort(input: Vec<i32>) -> Vec<i32> { // The algorithm
# input } pub fn access_point(input: Vec<i32>) -> Vec<i32> { println!("Doing something before the function call"); bubble_sort(input) }
} #[library_benchmark( config = LibraryBenchmarkConfig::default() .tool(Callgrind::default() .entry_point(EntryPoint::Custom("*::my_lib::bubble_sort".to_owned())) )
)]
#[bench::small(vec![3, 2, 1])]
#[bench::bigger(vec![5, 4, 3, 2, 1])]
fn bench_private(array: Vec<i32>) -> Vec<i32> { black_box(my_lib::access_point(array))
} library_benchmark_group!(name = my_group; benchmarks = bench_private);
# fn main() {
main!(library_benchmark_groups = my_group);
# } Note the #[inline(never)] we use in this example to make sure the bubble_sort function is not getting inlined. We use a wildcard *::my_lib::bubble_sort for EntryPoint::Custom for demonstration purposes. You might want to tighten this pattern. If you don't know how the pattern looks like, use EntryPoint::None first then run the benchmark. Now, investigate the callgrind output file . This output file is pretty low-level but all you need to do is search for the entries which start with fn=.... In the example above this entry might look like fn=algorithms::my_lib::bubble_sort if my_lib would be part of the top-level algorithms module. Or, using grep: grep '^fn=.*::bubble_sort$' target/iai/the_package/benchmark_file_name/my_group/bench_private.bigger/callgrind.bench_private.bigger.out Having found the pattern, you can eventually use EntryPoint::Custom.

