The default is to run Iai-Callgrind benchmarks with --separate-threads=yes, --trace-children=yes switched on. This enables Iai-Callgrind to trace threads and subprocesses, respectively. Note that --separate-threads=yes is not strictly necessary to be able to trace threads. But, if they are separated, Iai-Callgrind can collect and display the metrics for each thread. Due to the way callgrind applies data collection options like --toggle-collect, --collect-atstart, ... further configuration is needed in library benchmarks. To actually see the collected metrics in the terminal output for all threads and/or subprocesses you can switch on OutputFormat::show_intermediate: # extern crate iai_callgrind;
