Callgrind treats each thread and process as a separate unit and it applies data collection options to each unit. In library benchmarks the entry point (or the default toggle) for callgrind is per default set to the benchmark function with the help of the --toggle-collect option. Setting --toggle-collect also automatically sets --collect-atstart=no. If not further customized for a benchmarked multi-threaded function, these options cause the metrics for the spawned threads to be zero. This happens since each thread is a separate unit with --collect-atstart=no and the default toggle applied to the units. The default toggle is set to the benchmark function and does not hook into any function in the thread, so the metrics are zero. There are multiple ways to customize the default behaviour and actually measure the threads. For the following examples, we're using the benchmark and library code below to show the different customization options assuming this code lives in a benchmark file benches/lib_bench_threads.rs # extern crate iai_callgrind;
use iai_callgrind::{ main, library_benchmark_group, library_benchmark, LibraryBenchmarkConfig, OutputFormat
};
use std::hint::black_box; /// Suppose this is your library
pub mod my_lib { /// Return true if `num` is a prime number pub fn is_prime(num: u64) -> bool { if num <= 1 { return false; } for i in 2..=(num as f64).sqrt() as u64 { if num % i == 0 { return false; } } true } /// Find and return all prime numbers in the inclusive range `low` to `high` pub fn find_primes(low: u64, high: u64) -> Vec<u64> { (low..=high).filter(|n| is_prime(*n)).collect() } /// Return the prime numbers in the range `0..(num_threads * 10000)` pub fn find_primes_multi_thread(num_threads: usize) -> Vec<u64> { let mut handles = vec![]; let mut low = 0; for _ in 0..num_threads { let handle = std::thread::spawn(move || find_primes(low, low + 10000)); handles.push(handle); low += 10000; } let mut primes = vec![]; for handle in handles { let result = handle.join(); primes.extend(result.unwrap()) } primes }
} #[library_benchmark]
#[bench::two_threads(2)]
fn bench_threads(num_threads: usize) -> Vec<u64> { black_box(my_lib::find_primes_multi_thread(num_threads))
} library_benchmark_group!(name = my_group; benchmarks = bench_threads);
