The perhaps most reliable and flexible way to measure threads is using client requests . The downside is that you have to put some benchmark code into your production code. But, if you followed the installation instructions in client requests , this additional code is only compiled in benchmarks, not in your final production-ready library. Using the callgrind client request, we adjust the threads in the find_primes_multi_thread function like so: # fn find_primes(_a: u64, _b: u64) -> Vec<u64> { vec![] }
# extern crate iai_callgrind;
use iai_callgrind::client_requests::callgrind; /// Return the prime numbers in the range `0..(num_threads * 10000)`
pub fn find_primes_multi_thread(num_threads: usize) -> Vec<u64> { let mut handles = vec![]; let mut low = 0; for _ in 0..num_threads { let handle = std::thread::spawn(move || { callgrind::toggle_collect(); let result = find_primes(low, low + 10000); callgrind::toggle_collect(); result }); handles.push(handle); low += 10000; } let mut primes = vec![]; for handle in handles { let result = handle.join(); primes.extend(result.unwrap()) } primes
} and running the same benchmark now will show the collected metrics of the threads: lib_bench_threads::my_group::bench_threads two_threads:2 ## pid: 2149242 thread: 1 part: 1 |N/A Command: target/release/deps/lib_bench_threads-b85159a94ccb3851 Instructions: 27305|N/A (*********) L1 Hits: 66352|N/A (*********) L2 Hits: 344|N/A (*********) RAM Hits: 537|N/A (*********) Total read+write: 67233|N/A (*********) Estimated Cycles: 86867|N/A (*********) ## pid: 2149242 thread: 2 part: 1 |N/A Command: target/release/deps/lib_bench_threads-b85159a94ccb3851 Instructions: 2460501|N/A (*********) L1 Hits: 2534935|N/A (*********) L2 Hits: 13|N/A (*********) RAM Hits: 185|N/A (*********) Total read+write: 2535133|N/A (*********) Estimated Cycles: 2541475|N/A (*********) ## pid: 2149242 thread: 3 part: 1 |N/A Command: target/release/deps/lib_bench_threads-b85159a94ccb3851 Instructions: 3650408|N/A (*********) L1 Hits: 3724285|N/A (*********) L2 Hits: 1|N/A (*********) RAM Hits: 131|N/A (*********) Total read+write: 3724417|N/A (*********) Estimated Cycles: 3728875|N/A (*********) ## Total Instructions: 6138214|N/A (*********) L1 Hits: 6325572|N/A (*********) L2 Hits: 358|N/A (*********) RAM Hits: 853|N/A (*********) Total read+write: 6326783|N/A (*********) Estimated Cycles: 6357217|N/A (*********) Iai-Callgrind result: Ok. 1 without regressions; 0 regressed; 1 benchmarks finished in 0.49333s Using the client request toggles is very flexible since you can put the iai_callgrind::client_requests::callgrind::toggle_collect instructions anywhere in the threads. In this example, we just have a single function in the thread, but if your threads consist of more than just a single function, you can easily exclude uninteresting parts from the final measurements. If you want to prevent the code of the main thread from being measured, you can use the following: # extern crate iai_callgrind;
