Measuring multi-process applications is in principal not that different from multi-threaded applications since subprocesses are just like threads separate units. As for threads, the data collection options are applied to subprocesses separately from the main process. Note there are multiple valgrind command-line arguments that can disable the collection of metrics for uninteresting subprocesses, for example subprocesses that are spawned by your library function but are not part of your library/binary crate. For the following examples suppose the code below is the cat binary and part of a crate (so we can use env!("CARGO_BIN_EXE_cat") ): use std::fs::File;
use std::io::{copy, stdout, BufReader, BufWriter, Write}; # fn main() {
fn main() { let mut args_iter = std::env::args().skip(1); let file_arg = args_iter.next().expect("File argument should be present"); let file = File::open(file_arg).expect("Opening file should succeed"); let stdout = stdout().lock(); let mut writer = BufWriter::new(stdout); copy(&mut BufReader::new(file), &mut writer) .expect("Printing file to stdout should succeed"); writer.flush().expect("Flushing writer should succeed");
}
# } The above binary is a very simple version of cat taking a single file argument. The file content is read and dumped to the stdout. The following is the benchmark and library code to show the different options assuming this code is stored in a benchmark file benches/lib_bench_subprocess.rs # extern crate iai_callgrind;
