The maybe most important difference is, that the #[binary_benchmark] annotated function always needs to return an iai_callgrind::Command. Note this function builds the command which is going to be benchmarked but doesn't execute it, yet. So, the code in this function does not attribute to the event counts of the actual benchmark. # extern crate iai_callgrind;
# macro_rules! env { ($m:tt) => {{ "/some/path" }} }
use iai_callgrind::{binary_benchmark, binary_benchmark_group, main};
use std::path::PathBuf; #[binary_benchmark]
#[bench::foo("foo.txt")]
#[bench::bar("bar.json")]
fn bench_binary(path: &str) -> iai_callgrind::Command { // We can put any code in this function which is needed to configure and // build the `Command`. let path = PathBuf::from(path); // Here, if the `path` ends with `.txt` we want to see // the `Stdout` output of the `Command` in the benchmark output. In all other // cases, the `Stdout` of the `Command` is redirected to a `File` with the // same name as the input `path` but with the extension `out`. let stdout = if path.extension().unwrap() == "txt" { iai_callgrind::Stdio::Inherit } else { iai_callgrind::Stdio::File(path.with_extension("out")) }; iai_callgrind::Command::new(env!("CARGO_BIN_EXE_my-foo")) .stdout(stdout) .arg(path) .build()
} binary_benchmark_group!(name = my_group; benchmarks = bench_binary);
# fn main() {
main!(binary_benchmark_groups = my_group);
# }

