The entry point of the low-level api is the binary_benchmark_group # extern crate iai_callgrind;
# macro_rules! env { ($m:tt) => {{ "/some/path" }} }
use iai_callgrind::{ binary_benchmark, binary_benchmark_attribute, binary_benchmark_group, main, BinaryBenchmark, Bench
}; binary_benchmark_group!( name = my_group; benchmarks = |group: &mut BinaryBenchmarkGroup| { group.binary_benchmark(BinaryBenchmark::new("bench_binary") .bench(Bench::new("some_id") .command(iai_callgrind::Command::new(env!("CARGO_BIN_EXE_my-foo")) .arg("foo.txt") .build() ) ) ) }
); # fn main() {
main!(binary_benchmark_groups = my_group);
# } The low-level api mirrors the high-level api, "structifying" the macros. The binary_benchmark_group! is also a struct now, the BinaryBenchmarkGroup. It cannot be instantiated. Instead, it is passed as argument to the expression of the benchmarks parameter in a binary_benchmark_group. You can choose any name instead of group, we just have used group throughout the examples. There's the shorter benchmarks = |group| /* ... */ instead of benchmarks = |group: &mut BinaryBenchmarkGroup| /* ... */. We use the more verbose variant in the examples because it is more informative for benchmarking starters. Furthermore, the #[library_benchmark] macro correlates with iai_callgrind::LibraryBenchmark and #[bench] with iai_callgrind::Bench. The parameters of the macros are now functions in the respective structs. The return value of the benchmark function, the iai-callgrind::Command, is now also a function iai-callgrind::Bench::command. Note there is no iai-callgrind::Benches struct since specifying multiple commands with iai_callgrind::Bench::command behaves exactly the same way as the #[benches] attribute. So, the file parameter of #[benches] is a part of iai-callgrind::Bench and can be used with the iai-callgrind::Bench::file function.

