# macro_rules! env { ($m:tt) => {{ "/some/path" }} }
use iai_callgrind::{ binary_benchmark, binary_benchmark_attribute, binary_benchmark_group, main, BinaryBenchmark, Bench
}; #[binary_benchmark]
#[bench::some_id("foo")]
fn attribute_benchmark(arg: &str) -> iai_callgrind::Command { iai_callgrind::Command::new(env!("CARGO_BIN_EXE_my-binary")) .arg(arg) .build()
} binary_benchmark_group!( name = low_level; benchmarks = |group: &mut BinaryBenchmarkGroup| { group .binary_benchmark(binary_benchmark_attribute!(attribute_benchmark)) .binary_benchmark( BinaryBenchmark::new("low_level_benchmark") .bench( Bench::new("some_id").command( iai_callgrind::Command::new(env!("CARGO_BIN_EXE_my-binary")) .arg("bar") .build() ) ) ) }
); # fn main() {
main!(binary_benchmark_groups = low_level);
