There are actually multiple second ways to run Cachegrind as default tool (see also command-line arguments) but they have the same principle in common. For example in the benchmark file run a specific benchmark function with Cachegrind: # extern crate iai_callgrind;
# pub mod my_lib { pub fn bubble_sort(input: Vec<i32>) -> Vec<i32> { input } } use iai_callgrind::{ main, library_benchmark_group, library_benchmark, LibraryBenchmarkConfig, client_requests, ValgrindTool
};
use std::hint::black_box; #[library_benchmark( config = LibraryBenchmarkConfig::default() .default_tool(ValgrindTool::Cachegrind)
)]
#[bench::small(vec![3, 2, 1])]
#[bench::bigger(vec![5, 4, 3, 2, 1])]
fn bench_function(array: Vec<i32>) -> Vec<i32> { black_box(my_lib::bubble_sort(array))
} library_benchmark_group!(name = my_group; benchmarks = bench_function);
# fn main() {
main!(library_benchmark_groups = my_group);
# } However, this is not enough to get correct measurements. Only choosing Cachegrind as default tool will measure everything including setup and teardown, ... For this reason we need client requests to tell Cachegrind when to start and stop the instrumentation: # extern crate iai_callgrind;
# pub mod my_lib { pub fn bubble_sort(input: Vec<i32>) -> Vec<i32> { input } } use iai_callgrind::{ main, library_benchmark_group, library_benchmark, LibraryBenchmarkConfig, ValgrindTool, client_requests, Cachegrind
};
use std::hint::black_box; #[library_benchmark( config = LibraryBenchmarkConfig::default() .default_tool(ValgrindTool::Cachegrind) .tool(Cachegrind::with_args(["--instr-at-start=no"]))
)]
#[bench::small(vec![3, 2, 1])]
#[bench::bigger(vec![5, 4, 3, 2, 1])]
fn bench_function(array: Vec<i32>) -> Vec<i32> { client_requests::cachegrind::start_instrumentation(); let r = black_box(my_lib::bubble_sort(array)); client_requests::cachegrind::stop_instrumentation(); r
} library_benchmark_group!(name = my_group; benchmarks = bench_function);
# fn main() {
main!(library_benchmark_groups = my_group);
# } Not only the body of the benchmark function changed but also the command-line argument --instr-at-start=no had to be specified in order to start the instrumentation with the client request and not (what is the default) when starting the benchmark executable. All of the above is exactly what the cachegrind feature does. It adds the client requests to the function body, returns the result from the function and start cachegrind with --instr-at-start=no. The consequence and a disadvantage of cachegrind is that the function body had to be altered a little bit. It's not much but running other tools tools like Callgrind on the same benchmark function like Cachegrind would show small differences because the client requests add 10 - 20 instructions to the function body.

