main!(library_benchmark_groups = my_group);
# } As the standard toggle is now switched off and the option --collect-at-start=no is also omitted, you must specify --collect-at-start=no manually in LibraryBenchmarkConfig::raw_callgrind_args. Please see the docs for more details!

